    'name': 'Byteball',
    'description': "\n\nByteball is a decentralized database with it's own native cryptocurrency, Bytes, that unlike most does not require PoW or PoS mining and does not have a blockchain nor blocks. Instead, Byteball links transactions by signing the hashes from the previous transactions on the new one. These links\nbetween transactions form a DAG (Directed Acyclic Graph). Since Byteball has no blocks, there is no block size issue.\n\nByteball can be used as a means to transfer value between users in a transaction, either with Bytes or assets that can be issued on the network or as a decentralized data base that allows users to store information within it. Byteball's currency, Bytes, are used to pay transaction fees in this\nnetwork. Transactions can be meant to exchange value or to store any type of data. The transaction fees (Bytes) are relative to the Bytes used in the transaction, so if a transaction uses 500 Bytes, that's the tx fee that will be charged. This system gives the currency intrinsic value, each Byte is\nworth a byte of information that is stored on the network, which alows the system to scale according to its use.\n\n1 GBYTE equals 1000000000 BYTES\n\n",
